// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract ERC20TokenFactory {
    event ERC20TokenCreated(address indexed tokenAddress, address indexed creator);

    function createToken(
        string memory name,
        string memory symbol,
        uint256 initialSupply
    ) external returns (address) {
        ERC20Token newToken = new ERC20Token(name, symbol, initialSupply, msg.sender);
        emit ERC20TokenCreated(address(newToken), msg.sender);
        return address(newToken);
    }
}

contract ERC20Token is ERC20 {
    address public creator;

    constructor(
        string memory name,
        string memory symbol,
        uint256 initialSupply,
        address _creator
    ) ERC20(name, symbol) {
        _mint(_creator, initialSupply);
        creator = _creator;
    }
}

